import nav from "./nav.module.css"


export const Nav = () => {
    return(
        <ul className={nav.navMain}>
        <div>
        <li>Home</li>
        <li>News</li>
        <li>Contact</li>
        <li>About</li>
        </div>
      </ul>
    )
}
